import React from 'react';
import { TableContainer, Table, TableHead, TableRow, TableCell, TableBody, Paper } from '@material-ui/core';

class AirportList extends React.Component {
  render () {
    const {airports} = this.props;
    return (
      <TableContainer component={Paper}>
        <Table
          size="small"
          aria-label="a dense table"
        >
          <TableHead>
            <TableRow>
              <TableCell align='center'>Name</TableCell>
              <TableCell align='center'>Country</TableCell>
              <TableCell align='center'>Location</TableCell>
              <TableCell align='center'>
                Associated
                <TableCell align='center'>Landing to</TableCell>
                <TableCell align='center'>Departing from</TableCell>
              </TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {airports.map (airport => (
              <TableRow key={airport.name}>
                <TableCell component="th" scope="row">
                  {airport.name}
                </TableCell>
                <TableCell>{airport.calories}</TableCell>
                <TableCell>{airport.fat}</TableCell>
                <TableCell>{airport.carbs}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    );
  }
}

export default AirportList;
